import React from 'react';
import './App.css';
import UserBar from '../components/UserBar'
import Menu from '../components/Menu'
import QuestionCard from '../component/QuestionCard'

function App() {
  return (
    <div className="App">
      <UserBar/>
      <Menu/>
      <QuestionCard/>
    </div>
  );
}

export default App;
